/* 8. INTERROGAZIONI DEL CARICO DI LAVORO */

--Determinare l’identificatore dei giochi che coinvolgono al più quattro squadre e richiedono l’uso di due dadi.

SELECT id FROM gioco WHERE n_max_squadre = 4 AND n_dadi_iniziale = 2;

--No espressioni, No viste, No distinct, No sottoquery, nessun tuning possibile.

---------------------------------------------------------------------------------------------------------------------------

--Determinare l'identificatore delle sfide relative a un gioco A di vostra scelta che, in alternativa:
--Hanno avuto luogo a gennaio 2021 e durata massima superiore a 2 ore
--Hanno avuto luogo a marzo 2021 e durata massima pari a 30 minuti.

SELECT id_gioco, data_e_ora_inizio FROM sfida
WHERE id_gioco = 1500 AND ((data_e_ora_inizio >= '01-01-2021' AND data_e_ora_inizio <= '31-01-2021' AND durata_max > 120)
							OR
							(data_e_ora_inizio >= '01-03-2021' AND data_e_ora_inizio <= '31-03-2021' AND durata_max = 30));

--No espressioni, No viste, No distinct, No sottoquery, nessun tuning possibile.

---------------------------------------------------------------------------------------------------------------------------

--Determinare le sfide, di durata massima superiore a 2 ore, dei giochi che richiedono almeno due dadi.
--Restituire sia l’identificatore della sfida sia l’identificatore del gioco.

SELECT id_gioco, data_e_ora_inizio FROM sfida JOIN gioco ON id = id_gioco
WHERE durata_max > 120 AND n_dadi_iniziale > 1;

--No espressioni, No viste, No distinct, No sottoquery, nessun tuning possibile.

