/* 8. ULTERIORI INTERROGAZIONI E VISTA */

--La definizione di una vista che fornisca alcune informazioni riassuntive per ogni gioco: il numero di sfide relative
--a quel gioco disputate, la durata media di tali sfide, il numero di squadre e di giocatori partecipanti a tali sfide,
--i punteggi minimo, medio e massimo ottenuti dalle squadre partecipanti a tali sfide.

CREATE VIEW infogiochi AS
SELECT * FROM

(SELECT id_gioco, COUNT(data_e_ora_inizio) AS n_sfide_x_gioco,
AVG(Termine)::DECIMAL(5,2) AS durata_media
FROM sfida
GROUP BY id_gioco) AS first

NATURAL JOIN

(SELECT id_gioco, COUNT(squadra) AS n_squadre_non_dist_x_gioco,
MIN(punteggio) AS punteggio_minimo, MAX(punteggio) AS punteggio_massimo,
PERCENTILE_CONT(0.5) WITHIN GROUP(ORDER BY punteggio) AS punteggio_medio
FROM punteggio_totalizzato
GROUP BY id_gioco) AS second

NATURAL JOIN

(SELECT id_gioco, COUNT(nickname) AS n_utenti_non_dist_x_gioco
FROM partecipa NATURAL JOIN utenti_squadre
GROUP BY id_gioco) AS third;

---------------------------------------------------------------------------------------------------------------------------

--Determinare i giochi che contengono caselle a cui sono associati task.

SELECT id_gioco FROM casella WHERE id_task IS NOT NULL;

---------------------------------------------------------------------------------------------------------------------------

--Determinare i giochi che non contengono caselle a cui sono associati task.

SELECT id FROM gioco
EXCEPT
SELECT id_gioco FROM casella WHERE id_task IS NOT NULL;

--ALTERNATIVA--

SELECT id FROM gioco AS x
WHERE NOT EXISTS (SELECT * FROM casella WHERE id_gioco = x.id AND id_task IS NOT NULL);

--La prima non presenta sottoquery correlate e quindi è più efficiente.

---------------------------------------------------------------------------------------------------------------------------

--Determinare le sfide che hanno durata superiore alla durata media delle sfide relative allo stesso gioco.

SELECT id_gioco, data_e_ora_inizio FROM sfida AS x
WHERE Termine > (SELECT AVG(termine) FROM sfida WHERE id_gioco = x.id_gioco);

--La query presenta una sottoquery correlata, l'alternativa richiede un prodotto cartesiano.


/* 9. FUNZIONI E PROCEDURE RICHIESTE.. */


--Funzione che realizza l’interrogazione 2c in maniera parametrica rispetto all’ID del gioco
--(cioè determina le sfide che hanno durata superiore alla durata medie delle sfide di un dato gioco,
--prendendo come parametro l’ID del gioco).

CREATE FUNCTION int_2c (IN id_gioco_input INTEGER)
RETURNS TABLE (id_gioco INTEGER, data_e_ora_inizio TIMESTAMP) AS
$$
BEGIN
	RETURN QUERY SELECT x.id_gioco, x.data_e_ora_inizio FROM sfida AS x
	WHERE x.id_gioco = id_gioco_input AND termine >
						(SELECT AVG(termine) FROM sfida AS y WHERE y.id_gioco = id_gioco_input);
END;
$$ LANGUAGE plpgsql;


--Funzione di scelta dell’icona da parte di una squadra in una sfida: possono essere scelte solo le
--icone corrispondenti al gioco cui si riferisce la sfida che non siano già state scelte da altre squadre.

CREATE FUNCTION selezionaIcona (IN id_gioco_input INTEGER, IN data_e_ora_inizio_input TIMESTAMP, IN squadra_input CHAR, IN icona_input CHAR)
RETURNS VOID AS
$$
DECLARE
	setGioco CHAR(30);
BEGIN

	SELECT set INTO setGioco FROM gioco WHERE id = id_gioco_input;
	IF NOT FOUND
		THEN RAISE EXCEPTION 'Impossibile trovare il gioco di id = % !', id_gioco_input;
    END IF;

	IF NOT EXISTS (SELECT * FROM immagine WHERE nome = icona_input AND set = setGioco)
		THEN RAISE EXCEPTION 'L''icona selezionata non appartiene al gioco! Selezionarla dal set %', setGioco;
	END IF;

	IF EXISTS (SELECT * FROM partecipa WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND icona = icona_input)
		THEN RAISE EXCEPTION 'L''icona selezionata è già in utilizzo!';
	END IF;

	UPDATE partecipa SET icona = icona_input WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND squadra = squadra_input;
	IF NOT FOUND
		THEN RAISE EXCEPTION 'Impossibile trovare tale partecipazione!';
    END IF;
END;
$$ LANGUAGE plpgsql;


/* 10. TRIGGERS RICHIESTI */

--Verifica del vincolo che nessun utente possa partecipare a sfide contemporanee

CREATE FUNCTION una_sfida_alla_volta_f ()
RETURNS TRIGGER AS
$una_sfida_alla_volta_f$
BEGIN
	IF EXISTS (SELECT * FROM gameplatform.partecipa NATURAL JOIN gameplatform.utenti_squadre NATURAL JOIN gameplatform.sfida
					WHERE termine IS NULL AND nickname IN (SELECT nickname FROM gameplatform.utenti_squadre WHERE squadra = NEW.squadra))
		THEN RAISE EXCEPTION 'Un utente della squadra % che si vuole inserire in partecipa sta già partecipando ad una sfida non terminata', NEW.squadra;
		ELSE RETURN NEW;
	END IF;
END;
$una_sfida_alla_volta_f$ LANGUAGE plpgsql;

CREATE TRIGGER una_sfida_alla_volta_t
BEFORE INSERT OR UPDATE ON gameplatform.partecipa
FOR EACH ROW
EXECUTE PROCEDURE una_sfida_alla_volta_f();

--Mantenimento del punteggio corrente di ciascuna squadra in ogni sfida e inserimento delle icone opportune nella casella podio.

CREATE FUNCTION aggiornaPodio (IN id_gioco_input INTEGER, IN data_e_ora_inizio_input TIMESTAMP)
RETURNS VOID AS
$aggiornaPodio$
DECLARE
	selected_squadra CHAR(30);
	selected_icona CHAR(30);
	punteggio_massimo INTEGER;
	selected_id INTEGER;
BEGIN	--Si poteva usare un ciclo e costruire le query dinamicamente..
	UPDATE gameplatform.punteggio_totalizzato SET coordinate = null, icona = null WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input;
	
	SELECT MAX(punteggio) INTO punteggio_massimo FROM gameplatform.punteggio_totalizzato WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input;
	SELECT id INTO selected_id FROM gameplatform.punteggio_totalizzato WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND punteggio = punteggio_massimo;
	SELECT squadra INTO selected_squadra FROM gameplatform.punteggio_totalizzato WHERE id = selected_id;
	SELECT icona INTO selected_icona FROM gameplatform.partecipa WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND squadra = selected_squadra;
	UPDATE gameplatform.punteggio_totalizzato SET coordinate = '(10,10)', icona = selected_icona WHERE id = selected_id;
	
	SELECT MAX(punteggio) INTO punteggio_massimo FROM gameplatform.punteggio_totalizzato WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND coordinate IS NULL AND icona IS NULL;
	SELECT id INTO selected_id FROM gameplatform.punteggio_totalizzato WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND punteggio = punteggio_massimo AND coordinate IS NULL AND icona IS NULL;
	SELECT squadra INTO selected_squadra FROM gameplatform.punteggio_totalizzato WHERE id = selected_id;
	SELECT icona INTO selected_icona FROM gameplatform.partecipa WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND squadra = selected_squadra;
	UPDATE gameplatform.punteggio_totalizzato SET coordinate = '(0,5)', icona = selected_icona WHERE id = selected_id;

	SELECT MAX(punteggio) INTO punteggio_massimo FROM gameplatform.punteggio_totalizzato WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND coordinate IS NULL AND icona IS NULL;
	SELECT id INTO selected_id FROM gameplatform.punteggio_totalizzato WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND punteggio = punteggio_massimo AND coordinate IS NULL AND icona IS NULL;
	SELECT squadra INTO selected_squadra FROM gameplatform.punteggio_totalizzato WHERE id = selected_id;
	SELECT icona INTO selected_icona FROM gameplatform.partecipa WHERE id_gioco = id_gioco_input AND data_e_ora_inizio = data_e_ora_inizio_input AND squadra = selected_squadra;
	UPDATE gameplatform.punteggio_totalizzato SET coordinate = '(20,0)', icona = selected_icona WHERE id = selected_id;
END;
$aggiornaPodio$ LANGUAGE plpgsql;

CREATE FUNCTION Aggiorna_punteggio_e_podio_QUIZ_f ()
RETURNS TRIGGER AS
$Aggiorna_punteggio_e_podio_QUIZ_f$
DECLARE
	squadra_consegnante CHAR(30);
	n_utenti_squadra_consegnante INTEGER;
	n_consegne_effettive INTEGER;
	n_massimo_consegne_x_risposta INTEGER;
	testo_risposta_candidata CHAR(30);
	punti_risposta_candidata INTEGER;
	punteggio_attuale INTEGER;
BEGIN
	SELECT squadra INTO squadra_consegnante FROM gameplatform.partecipa
	WHERE id_gioco = NEW.id_gioco AND data_e_ora_inizio = NEW.data_e_ora_inizio AND
	squadra IN (SELECT squadra FROM gameplatform.utenti_squadre WHERE nickname = NEW.nickname);

	SELECT COUNT(nickname) INTO n_utenti_squadra_consegnante FROM gameplatform.utenti_squadre
	WHERE squadra = squadra_consegnante;

	SELECT COUNT(nickname) INTO n_consegne_effettive FROM consegna_risposta
	WHERE id_gioco = NEW.id_gioco AND data_e_ora_inizio = NEW.data_e_ora_inizio AND id_quiz = NEW.id_quiz AND nickname IN (SELECT nickname FROM utenti_squadre WHERE squadra = squadra_consegnante);

	IF n_consegne_effettive = n_utenti_squadra_consegnante
		THEN RAISE NOTICE 'La squadra % completa la consegna, aggiorno il punteggio e podio..', squadra_consegnante;
			SELECT MAX(x) INTO n_massimo_consegne_x_risposta FROM
				(SELECT COUNT(nickname) AS x FROM consegna_risposta WHERE id_gioco = NEW.id_gioco AND data_e_ora_inizio = NEW.data_e_ora_inizio AND id_quiz = NEW.id_quiz AND nickname IN (SELECT nickname FROM utenti_squadre WHERE squadra = squadra_consegnante) GROUP BY testo) AS y;
			SELECT testo INTO testo_risposta_candidata FROM consegna_risposta WHERE id_gioco = NEW.id_gioco AND data_e_ora_inizio = NEW.data_e_ora_inizio AND id_quiz = NEW.id_quiz AND nickname IN (SELECT nickname FROM utenti_squadre WHERE squadra = squadra_consegnante) GROUP BY testo HAVING COUNT(nickname) = n_massimo_consegne_x_risposta;
			SELECT punti INTO punti_risposta_candidata FROM risposta WHERE id_quiz = NEW.id_quiz AND testo = testo_risposta_candidata;
			SELECT punteggio INTO punteggio_attuale FROM gameplatform.punteggio_totalizzato WHERE id_gioco = NEW.id_gioco AND data_e_ora_inizio = NEW.data_e_ora_inizio AND squadra = squadra_consegnante;
			UPDATE gameplatform.punteggio_totalizzato SET punteggio = punteggio_attuale + punti_risposta_candidata WHERE id_gioco = NEW.id_gioco AND data_e_ora_inizio = NEW.data_e_ora_inizio AND squadra = squadra_consegnante;
			PERFORM aggiornaPodio(NEW.id_gioco,NEW.data_e_ora_inizio);
			RETURN NULL;
		ELSE RAISE NOTICE 'Ancora % affinchè la squadra % completi la consegna', n_utenti_squadra_consegnante - n_consegne_effettive, squadra_consegnante;
			RETURN NULL;
	END IF;
END;
$Aggiorna_punteggio_e_podio_QUIZ_f$ LANGUAGE plpgsql;

CREATE TRIGGER Aggiorna_punteggio_e_podio_QUIZ_t
AFTER INSERT OR UPDATE ON gameplatform.consegna_risposta
FOR EACH ROW
EXECUTE PROCEDURE Aggiorna_punteggio_e_podio_QUIZ_f();

